import React, { useEffect, useState } from "react";
import '../../component/grid.css';
import '../header/header.css';
import '../../component/style.css';
import '../header/responsive.css';
import logo from '../img/logo.png';
import axios from 'axios';
import { Link } from 'react-router-dom';

const Header = () => {
    const [theLoaisMobile, setTheLoaisMobile] = useState([]);
    const [loadingMobile, setLoadingMobile] = useState(true);

    useEffect(() => {
        const fetchTheLoaisMobile = async () => {
            setLoadingMobile(true);
            try {
                const response = await axios.get('http://localhost:3001/theloais');
                setTheLoaisMobile(response.data);
            } catch (error) {
                console.error("Lỗi khi tải danh mục thể loại (mobile):", error);
            } finally {
                setLoadingMobile(false);
            }
        };

        fetchTheLoaisMobile();
    }, []);

    return (
        <header id="header">
            <div className="header-top hide-on-mobile">
                <div className="grid wide">
                    <div className="row">
                        {/* ... phần header top không thay đổi ... */}
                    </div>
                </div>
            </div>
            <div className="header-bottom">
                <div className="pc-tablet-header hide-on-mobile">
                    <div className="grid wide">
                        <div className="row flex-center">
                            {/* ... phần header bottom cho PC/Tablet không thay đổi ... */}
                        </div>
                    </div>
                </div>
                <div className="mobile-header hide-on-tablet-pc">
                    <div className="grid">
                        <div className="row">
                            {/* ... phần mobile header trên không thay đổi ... */}
                            <div className="mobile-header-item col c-8 displayflex">
                                {/* ... các icon user, giỏ hàng không thay đổi ... */}
                                <div className="mobile-menu-navbar">
                                    <label
                                        htmlFor="nav-mobile-input"
                                        className="a-link displayflex"
                                        style={{ cursor: "pointer" }}
                                    >
                                        <div style={{ lineHeight: 2, paddingRight: 5 }}>MENU</div>
                                        <i
                                            className="fa fa-bars"
                                            style={{ fontSize: 25, paddingTop: 1, marginRight: 20 }}
                                        />
                                    </label>
                                    <input
                                        type="checkbox"
                                        className="nav_input"
                                        id="nav-mobile-input"
                                        style={{ display: "none" }}
                                    />
                                    <label htmlFor="nav-mobile-input" className="nav_overlay" />
                                    <div className="nav_mobile">
                                        <label
                                            htmlFor="nav-mobile-input"
                                            className="nav_mobile-close"
                                        >
                                            <div style={{ fontSize: 12, margin: 4, lineHeight: 2 }}>
                                                ĐÓNG
                                            </div>
                                            <i className="fas fa-times" />
                                            <br />
                                        </label>
                                        <div className="nav_mobile-find displayflex">
                                            {/* ... form tìm kiếm mobile không thay đổi ... */}
                                        </div>
                                        <div className="nav_mobile-list">
                                            <ul>
                                                {loadingMobile ? (
                                                    <li>Đang tải danh mục...</li>
                                                ) : (
                                                    theLoaisMobile.map(theLoai => (
                                                        <li key={theLoai.id} className="list-box-item">
                                                            <Link
                                                                className="danhmuc-a"
                                                                to={`/theloai/${theLoai.id}`}
                                                            >
                                                                {theLoai.tentheloai}
                                                            </Link>
                                                        </li>
                                                    ))
                                                )}
                                            </ul>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </header>
    )
}

export default Header;
